%[text] %[text:anchor:T_2B6DA392] # **Scatter Box Chart Examples**
%[text] %[text:anchor:H_7467FA40] **Overview**
%[text] The `ScatterBoxChart` manages a bivariate scatter plot with marginal boxplots. The chart data comprises two numeric vectors (`XData` and `YData`) . The `YData` is scattered against the `XData` on the main chart axes, and the marginal boxplots for the `XData` and `YData` are drawn on separate axes underneath and to the left of the main axes, respectively.
%[text] ![ScatterBoxChart.png](text:image:32d5)
%[text] **Documentation**
%[text] - [`scatter`](<matlab: doc( "scatter" )>): create a scatter plot with variable marker color and size
%[text] - [`boxchart`](<matlab: doc( "boxchart" )>): create a boxchart with variable properties \
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:H_AE7E717B] ## Create sample x and y data for the chart.
rng( "default" )
x = randn( 1000, 1 );
y = 2 * x + 1 + 3 * randn( size( x ) );
%%
%[text] %[text:anchor:H_AC0C4515] ## Create a figure for the chart.
f = exampleFigure( "Name", "ScatterBoxChart Example" ); %[output:69e4052e]
%%
%[text] %[text:anchor:H_FB414886] ## Create the chart, specifying the parent, position and input data.
SBC = ScatterBoxChart( "Parent", f, ...     %[output:group:7e3c9b75] %[output:69e4052e]
    "XData", x, ... %[output:69e4052e]
    "YData", y ); %[output:group:7e3c9b75] %[output:69e4052e]
%%
%[text] %[text:anchor:H_2A7FC7B3] ## Annotate the chart.
xlabel( SBC, "x-data", "FontSize", 14 ) %[output:151482ff]
ylabel( SBC, "y-data", "FontSize", 14 ) %[output:151482ff]
title( SBC, "Scatter Boxchart", "FontSize", 16 ) %[output:151482ff]
legend( SBC, "(x, y) data" ) %[output:151482ff]
grid( SBC, "on" ) %[output:151482ff]
%%
%[text] %[text:anchor:H_3F03D641] ## Customize the scatter plot appearance.
%[text] First, change the marker used for the scatter plot.
SBC.ScatterMarker = "square"; %[output:066a8416]
%%
%[text] %[text:anchor:H_A3F0C4DA] ## Next, specify that the scatter plot should have filled markers.
SBC.FilledScatterMarkers = true; %[output:13a8c10b]
%%
%[text] %[text:anchor:H_4426B5E6] ## The marker size in the scatter plot is uniform by default.
%[text] We can set a uniform, constant value for the `ScatterSizeData` property.
SBC.ScatterSizeData = 6; %[output:6bc77008]
%%
%[text] %[text:anchor:H_B3DF85F0] ## We can also use variable size markers for the scatter plot.
%[text] Let's create a regularly-spaced vector of marker size values.
variableMarkerSizes = linspace( 1, 50, numel( SBC.XData ) );
%[text] Update the chart to use these sizes for the scattered data points.
SBC.ScatterSizeData = variableMarkerSizes; %[output:407c3509]
%%
%[text] %[text:anchor:H_8C459A94] ## Similarly, the scatter plot color is uniform by default.
%[text] We can set a uniform, constant value for the `ScatterCData` property.
SBC.ScatterCData = [1, 0.5, 0];   %[output:5e435b8f]
%%
%[text] %[text:anchor:H_E8B3B593] ## We can also use variable colors for the scatter plot.
%[text] %[text:anchor:H_C58FC1E9] Let's apply a color gradient to the scatter series based on each point's distance from the origin (0, 0).
%[text] First, create the color scheme by indexing into a predefined MATLAB colormap.
d = sqrt( x.^2 + y.^2 );
n = numel( x );
d = round( 1 + ( n - 1 ) * rescale( d ) );
map = cool( n );
colorGradient = map(d, :);
%[text] Apply the color gradient to the chart's scatter series.
SBC.ScatterCData = colorGradient; %[output:52a0806b]
%%
%[text] %[text:anchor:H_27DF88B0] ## Customize the marginal boxplots.
%[text] As well as having the flexibility to customize the scatter plot representing the joint density of the $(x, y)$ data, we can also adjust the appearance of the marginal $x$- and $y$-boxplots. When modifying these properties, all changes apply to both marginal boxplots.
%[text] %[text:anchor:H_30B09DA9] For example, we can change the boxcharts' box color.
SBC.BoxFaceColor = "magenta"; %[output:613eff62]
%%
%[text] %[text:anchor:H_4ADBB0C0] ## Adjust the boxcharts' whiskers and box appearance.
%[text] Change the whisker line style.
SBC.WhiskerLineStyle = ":"; %[output:1bf9a861]
%[text] Change the whisker line color.
SBC.WhiskerLineColor = [0, 0.5, 1]; %[output:1bf9a861]
%[text] Change the whisker line width and the width of the lines used to display the box.
SBC.BoxLineWidth = 2; %[output:1bf9a861]
%%
%[text] %[text:anchor:H_20505742] ## Modify the boxcharts' outlier appearance.
%[text] We use the [set](<matlab: doc( "set" )>) function to assign multiple chart properties in one command.
set( SBC, "BoxMarker", ".", ... %[output:group:0850dd5f] %[output:184eac8d]
    "BoxMarkerSize", 20, ... %[output:184eac8d]
    "BoxMarkerColor", [0.8, 0.3, 0] ) %[output:group:0850dd5f] %[output:184eac8d]
%%
%[text] %[text:anchor:H_38F80DD5] ## Change the x-data of the chart.
%[text] The chart supports individual or simultaneous changes to its $x$-data and $y$-data, including changes in the length of the data.
SBC.XData = x(1:500); %[output:93d0cf3c]
%%
%[text] %[text:anchor:H_1AE83155] ## Change the y-data of the chart.
SBC.YData = (-1) * SBC.XData + randn( size( SBC.XData ) ); %[output:0f57d451]
%%
